import { Outlet } from 'react-router-dom';
import Navbar from './Navbar';
import './layout.css';

function Layout() {
  return (
    <>
      <body className="top">
        <Navbar />
        <div className="content">
          <Outlet />
        </div>
      </body>
    </>
  );
}

export default Layout;
